import Me from './assets/images/me.png';
import './assets/stylesheets/nav.scss';

class Nav extends Component {
    render() {
        return (
            <header className="navbar bg-dark navbar-expand-md navbar-floating navbar-sticky navbar-dark" data-fixed-element="">
                <div className="container">
                    <a className="navbar-brand" href="index.html">
                        <img className="navbar-floating-logo d-none d-lg-block" src="/static/media/me.cb5565dc.png" alt="Around" width="100"/>
                            </a>
                        <ul className="navbar-nav">
                            <li className="nav-item">
                                <a className="nav-link" href="#">Portfolio</a>
                            </li>
                        </ul>
                        </div>
                        </header>



            // <div className="d-flex flex-column flex-md-row align-items-center p-3 px-md-4 mb-3">
            //     <a className="navbar-brand my-0 mr-md-auto" href="index.html">
            //         <img className="" src={Me} alt="Memoji" width="100" />
            //     </a>
            //     <nav className="my-2 my-md-0 mr-md-3">
            //         <ul className="nav justify-content-end">
            //             <li className="nav-item">
            //                 <a className="nav-link" href="#">Portfolio</a>
            //             </li>
            //         </ul>
            //     </nav>
            // </div>
        )
    }
}

export default Nav
